// Base64 encoded PT Sans font data
export const ptSansFontData = {
  normal: '',
  bold: '',
  italic:''
};

// Function to initialize fonts for jsPDF
export function initFonts(doc) {
  try {
    // Add PT Sans Regular
    doc.addFileToVFS('PTSans-Regular.ttf', ptSansFontData.normal);
    doc.addFont('PTSans-Regular.ttf', 'PT Sans', 'normal');

    // Add PT Sans Bold
    doc.addFileToVFS('PTSans-Bold.ttf', ptSansFontData.bold);
    doc.addFont('PTSans-Bold.ttf', 'PT Sans', 'bold');

    // Add PT Sans Italic
    doc.addFileToVFS('PTSans-Italic.ttf', ptSansFontData.italic);
    doc.addFont('PTSans-Italic.ttf', 'PT Sans', 'italic');

    // Set default font
    doc.setFont('PT Sans');
    
    return true;
  } catch (error) {
    console.error('Error initializing fonts:', error);
    return false;
  }
}